import React from "react";

const searchResult = ({error, data}) => {
    return (
    data.map((item) => <div>
      <div>
        <img className="profileImage rounded" src=""></img>
        <div>
          <p>Name</p>
        </div>
        <a href="#">Follow</a>
      </div>
    </div>
 ));
}

export default searchResult;
